import { Link } from "react-router-dom";

import PreFooter from "./PreFooter";
import { footerlinks } from "../constants";

const Footer = () => {
  return (
    <footer className=" bg-zinc-800">
      <div className="max-container h-50 pb-4">
        <PreFooter />
        <div className="flex flex-col justify-between sm:flex-row px-6 sm:px-4 xl:px-0 md:max-w-screen mx-auto my-0 space-y-6 pb-4">
          <div className="px-10 items-center align-middle">
            <h1 className="text-white font-palanquin font-semibold text-2xl ">
              Meetup
            </h1>
            <p className="text-white">Connect. Discover. Grow.</p>
          </div>
          <nav className="flex pl-10 justify-around flex-1 lg:gap-10 flex-wrap">
            {footerlinks.map((section) => (
              <nav key={section.title} className="">
                <h4 className="text-white">{section.title}</h4>
                <ul>
                  {section.links.map((link) => (
                    <li
                      className="mt-3 mb-3 w-1/3 text-white font-montserrat text-base leading-normal hover:text-orange-800"
                      key={link.name}
                    >
                      <Link to={link.page}>{link.name}</Link>
                    </li>
                  ))}
                </ul>
              </nav>
            ))}
          </nav>
        </div>
      </div>
      <div className="py-5 bg-slate-700">
        <h1 className="text-white">Â© 2023 Meetup. All rights reserved</h1>
      </div>
    </footer>
  );
};

export default Footer;
